def rotate(l, n):
    return l[-n:] + l[:-n]


def _make_keypad():
    keypad = '''    1
  2 3 4
5 6 7 8 9
  A B C
    D'''
    keypad = [s.split(' ') for s in keypad.split('\n')]
    for x in range(5):
        keypad[x] = rotate(keypad[x], -abs(x - 2))
    return keypad


class KeypadFinger:
    _keypad = _make_keypad()

    def __init__(self):
        self._pos = [0, 2]

    def get_x(self):
        return self._pos[0]

    def get_y(self):
        return self._pos[1]

    def _set_x(self, x):
        self._pos[0] = x if 0 <= x <= 4 and not KeypadFinger._keypad[x][self.get_y()] == '' else self.get_x()

    def _set_y(self, y):
        self._pos[1] = y if 0 <= y <= 4 and not KeypadFinger._keypad[self.get_x()][y] == '' else self.get_y()

    def move(self, d):
        d = d.upper()
        if d == 'U':
            self._set_y(self.get_y() - 1)
        elif d == 'D':
            self._set_y(self.get_y() + 1)
        elif d == 'L':
            self._set_x(self.get_x() - 1)
        elif d == 'R':
            self._set_x(self.get_x() + 1)
        else:
            raise ValueError("Input must be 'U', 'D', 'R', or 'L'")

    def get_key(self):
        return self._keypad[self.get_y()][self.get_x()]

input = '''



'''

input = input.split('\n')

k = KeypadFinger()

code = ''
for line in input:
    for c in line:
        k.move(c)
    code += str(k.get_key())

print(code)
